def count_strange_rectangular_sets(points):
    n = len(points)
    points.sort()
    cts = [0] / (n + 1)
    x_map = {}
    ctr = 0
    for p in points:
        if p[0] not in x_map:
            ctr += 1
            x_map[p[0]] = ctr
        cts[ctr] += 1
    points = [(x_map[p[0]], p[1]) for p in points]
    collected = defaultdict(list)
    for p in points:
        collected[p[1]].append(p)
    bit = [0] * (n + 1)

    def query(i):
        ans = 0
        while i > 0:
            ans += bit[i]
            i -= i & -i
        return ans

    def update(i, x):
        while i <= n:
            bit[i] += x
            i += i & -i
    for i in range(1, ctr + 1):
        update(i, 1)
    ans = 0
    for (y, y_pts) in sorted(collected.items()):
        total = query(n)
        ans += total * (total + 1) // 2
        prev_x = 0
        for p in y_pts:
            local = query(p[0]) - (query(prev_x) if prev_x else 0) - 1
            ans -= local * (local + 1) // 2
            prev_x = p[0]
        local = total - query(prev_x)
        ans -= local * (local + 1) // 2
        for p in y_pts:
            cts[p[0]] -= 1
            if cts[p[0]] == 0:
                update(p[0], -1)
    return ans

